import { BrowserRouter, Switch, Route } from 'react-router-dom';
import { HomeView } from '../views/HomeView';
import { GuidelineView } from "../views/GuidelineView";
import { ProductsView } from "../views/ProductsView";
import { BrandsView } from "../views/BrandsView";
import RoutingPath from './RoutingPath';
import { SigninView } from '../views/SigninView';
import { UserContext } from "../utils/provider/UserProvider";
import { useEffect, useContext } from "react";

export const Routes = ({ children }) => {
    return (
        <BrowserRouter>
            {children}
            <Switch>
                <Route exact path={RoutingPath.HomeView} component={HomeView} />
                <Route exact path={RoutingPath.BrandsView} component={BrandsView} />
                <Route exact path={RoutingPath.ProductsView} component={ProductsView} />
                <Route exact path={RoutingPath.GuidelineView} component={GuidelineView} />
                <Route exact path={RoutingPath.SigninView} component= {SigninView} />
            </Switch>
        </BrowserRouter>
    )
}
